import React, {Component} from 'react';
import './style/nav.css';
class Nav extends Component{
    render(){
        return(
            <div className="sidebar">
                <div className="logo_content">
                    <div className="logo">
                        <div className="logo_name">

                        </div>
                    </div>
                </div>
            </div>
        )
    }
}

export default Nav;
